        async function doUnlock() {
            const pw = document.getElementById('pw').value;
            const msg = document.getElementById('msg');
            try {
                const dec = CryptoJS.AES.decrypt(_payload, pw).toString(CryptoJS.enc.Utf8);
                if(!dec) throw new Error();
                const result = JSON.parse(dec);
                window._db = result.db;
                
                const _originOpen = window.open;
                window.open = function(u, target) {
                    if(!u || u==='#' || u.startsWith('javascript')) return null;
                    if(u.startsWith('http') || u.startsWith('evernote') || u.startsWith('mailto')){ 
                        _originOpen(u, '_blank'); return null; 
                    }
                    const n = decodeURIComponent(u).split('/').pop().split('#')[0].split('?')[0];
                    const f = window._db[n] || window._db[decodeURIComponent(n)];
                    if(f){
                        const bin = atob(f.data.split(',')[1]);
                        const arr = new Uint8Array(bin.length);
                        for(let i=0;i<bin.length;i++) arr[i]=bin.charCodeAt(i);
                        const b = new Blob([arr], {type: f.type==='PDF'?'application/pdf':'text/html'});
                        _originOpen(URL.createObjectURL(b), '_blank');
                    } else {
                        _originOpen(u, target || '_blank');
                    }
                    return null;
                };

                document.open();
                document.write(result.index);
                document.close();

                document.addEventListener('click', e => {
                    const a = e.target.closest('a');
                    if(a && a.getAttribute('href')){
                        const href = a.getAttribute('href');
                        if(!href.startsWith('http') && !href.startsWith('#') && !href.startsWith('javascript')){
                            e.preventDefault();
                            window.open(href);
                        }
                    }
                }, true);
            } catch (e) { msg.style.display = 'block'; }
        }
        document.getElementById('pw').addEventListener('keypress', e => { if(e.key==='Enter') doUnlock(); });
    </script>
